import {Link} from 'react-router-dom'
import React from 'react'
import styled from 'styled-components'

export const Palette = {
    first : "#cce8cc",
    secondary :"#F6EFEE", 
    third : "#e2b6cf",
    fourth : "#e396df", 
    fifth : "#e365c1"
}

const StyledHeader = styled.header`
    background-color : ${Palette.first};
    margin-bottom : 10px;
    box-shadow : 1px 1px 4px grey; 
`


export default function Header() {
    return (
        <StyledHeader className="navbar d-flex">
            <p className="col-3 col-lg-3">Big project</p>
            <button className="btn"><Link to="/" className="col-3 col-lg-3">Home</Link></button>
            <button className="btn"><Link to="/Widgets" className="col-3 col-lg-3">Home</Link></button>
            <button className="btn"><Link to="/Calculator" className="col-3 col-lg-3">Calculator</Link></button>
        </StyledHeader>
    )
}
